import ReactDOM from 'react-dom';
import xml2js from 'xml2js';

function Sitemap() {

    return fetchSitemap("https://www.smu.edu.sg/sitemap.xml", formatData);;
}

function fetchSitemap(url, callback) {
    let json = '';
    fetch(url)
    .then(res => res.text())
    .then(xmldata => {
        var parser = new xml2js.Parser();
        parser.parseString(xmldata, function (err, result) {
            json = result;
        });
    })
    .then(() => callback(json));
}

function formatData(json) {
    console.log("sitemapJson", json);
}

export default Sitemap;
